import styled from 'styled-components';

export const BoardBody = styled.main`
  align-items: center;
  display: flex;
  flex-direction: column;
`;

export const Square = styled.div`
  width: 50px;
  height: 50px;

`;

export const Line = styled.div`
  display: flex;
  flex-direction: row;

  :nth-child:(ODD){
    background: black;
  }

`;
